import { Link } from "react-router-dom";

const Header = () => {
  return (
    <>
        <div className="nav-bar">
          <li> 
            <Link to ="/">Home</Link>
          </li> 
          <li>
            <Link to ="/about">About</Link>
          </li>  
          <li>
            <Link to ="/product">Product</Link>
          </li>
        </div>
    </>
  );
};

export default Header;
